import { Component } from 'react';

class TOC extends Component {

    render() {

        let lists = [];
        const data = this.props.data;
        let i = 0;
        while (i < data.length) {
            lists.push(`
                <li><a href="1.html">${data[i].title}</a></li>
            `);
            i = i + 1;
        }



        return (
            <nav>
                <ul>
                    {lists}-1
                    <li><a href="1.html">HTML</a></li>
                    <li><a href="2.html">CSS</a></li>
                    <li><a href="3.html">Javascript</a></li>
                </ul>
            </nav>
        );
    }
}


export default TOC;
